import React, { useReducer } from "react";

function setCounterValue(state, action) {}

const MyReducer = () => {
  const [myCounter, setMyCounter] = React.useReducer(setCounterValue, 0);

  return (
    <div>
      <h2>MyReducer</h2>
      <p>현재 카운트 값: {myCounter}</p>
    </div>
  );
};

export default MyReducer;
